import Link from 'next/link'

const OperatorTile = ({ props }) => {

    return(
        // <Link></Link>
        <div>
            <h2>{props.operatorName}</h2>
            <Link as={`/pay/${props.operatorName}`} href={`/pay/[payOperatorID]`}>Пререйти к оплате</Link>
        </div>
    )
}

export default OperatorTile
